import React from 'react'

const BoardCreate = () => {

  const createBoard = (e) => {
    e.preventDefault();
  }


  return (
    <form onSubmit={createBoard}>
      <label htmlFor="title">제목</label>
      <input type="text" id='title'/>
      <label htmlFor="title">내용</label>
      <input type="text" id='title'/>
      <label htmlFor="title">작성자</label>
      <input type="text" id='title'/>
      <button>등록</button>
    </form>
  )
}

export default BoardCreate
